import MainPage from "../components/MainPage";

export const routes = [
	{
		path: '/',
		exact: true,
		component: MainPage,
	},
	{
		path: '/my-products',
		exact: true,
		component: MainPage,
	},
	{
		path: '/',
		exact: true,
		component: MainPage,
	},
	{
		path: '/',
		exact: true,
		component: MainPage,
	},
]
